#include <iostream>#include <map>#include <vector>#include <algorithm>#include <numeric>int main(){    std::vector<int> t(5);    for(int i = 0; i < 5; ++i){        std::cin >> t.at(i);    }    std::vector<int> ten(5);    for(int i = 0; i < 5; ++i){        ten.at(i) = ((t.at(i) + 9) / 10) * 10;     }    std::vector<int> diff(5);    for(int i = 0; i < 5; ++i){        diff.at(i) = ten.at(i) - t.at(i);     }    int maxDiffIndex = std::distance(diff.begin(), max_element(diff.begin(), diff.end()));    int ans = 0;    for(int i = 0; i < 5; ++i){        if(maxDiffIndex == i){           ans += t.at(i);        }else{           ans += ten.at(i);        }    }    std::cout << ans << std::endl;    return 0;}